import React from 'react';
import './Screening.css';

const Screening = ({ funcion }) => {
    return (
        <div>
            <h5 className="card-title">{funcion.dimension}+" "+{funcion.categoria}</h5>
            <button className="" type='buttom'>funcion.fechaInicio</button>
        </div>
    );
}

export default Screening;
